import { useState , useEffect } from "react"
import axios from "axios"
import  Cookie  from "universal-cookie"
const AccountsInfo = () => {
    const [accountInfo , setAccountInfo] = useState([])
    const cookie = new Cookie()
    const token = cookie.get('bearer')

    useEffect(()=>{
        axios.get('http://127.0.0.1:8000/api/accounts',{
            headers:{
                Authorization : "Bearer " + token
            }
        }).then((res)=>setAccountInfo(res.data.data))
        //eslint-disable-next-line react-hooks/exhaustive-deps
    },[])
    const tr = accountInfo.map((item , index)=>{
        return <tr key={index}>
            <td>{item.customer.firstName}</td>
            <td>{item.customer.lastName}</td>
            <td>{item.customer.ID_number}</td>
            <td>{item.branch.address}</td>
            <td>{item.accountNumber}</td>
            <td>{item.accmonies[0].balance}</td>
            <td>{item.accmonies[1].balance}</td>
            <td>{item.accmonies[2].balance}</td>
            <td>{item.type}</td>
            <td>{item.openingDate}</td>
        </tr>
    })
    number.toFixed(2)
   
  return (
    <>
        <table dir='rtl' className="account-info">
        <thead >
            <tr>
                <th>اسم العميل</th>
                <th>الكنية</th>
                <th>الرقم الوطني</th>
                <th>الفرع</th>
                <th>رقم الحساب</th>
                <th>الرصيد بالدولار</th>
                <th>الرصيد بالليرة التركية</th>
                <th>الرصيد باليورو</th>
                <th>نوع الحساب</th>
                <th>تاريخ التسجيل</th>
            </tr>
        </thead>
        <tbody>
            {tr}
        </tbody>
    </table>
    </>
  )
}

export default AccountsInfo
